import Footer from "./Footer";
import Header from "./Header";
import App from "../App";
import "../css/intro.css";
import { Routes, Route, Link, useNavigate } from 'react-router-dom';

const Intro = () => {
  const navigate = useNavigate();

  const handleStartClick = () => {
    navigate("/App");
  };

  return (
    <div>
      <Header />
      <div className="main-img">이미지영역</div>
      <div className="btn-group" role="group" aria-label="Basic mixed styles example">
        <Link to="/#">
          <button type="button" className="btn btn-tutorial">튜토리얼</button>
        </Link>
        <button type="button" className="btn btn-start" onClick={handleStartClick}>
          시작하기
        </button>
        <button type="button" className="btn btn-metamask">
          <a href="chrome-extension://nkbihfbeogaeaoehlefnkodbefgpgknn/home.html#">메타마스크로 이동</a>
        </button>
      </div>

      <Routes>
        <Route path="/App" element={<App />} />
      </Routes>

      <Footer />
    </div>
  );
}

export default Intro;
